import React, { Fragment } from "react";
import { Head } from "./HeaderStyles";
import tableimg from '../assets/meals.jpeg'
const Header=()=>{

    return (
        <Fragment>
         <Head>
           <h1 className="logo">ReactMeals</h1>
           <button>Cart</button>
         </Head>
          <div>
           <img src={tableimg} alt='img table   '/>
          </div>

        </Fragment>

    )
}

export default Header
